pragma solidity ^0.5.0;

/*
  @title
  @author Nish
  @notice
  @dev
*/

contract Accums
{

  struct Member
  {
    string FirstName;
    string LastName;
    uint256 DOB;
    uint256 PatientId;
    uint256 MemberId;
    uint256 StartDate;
    uint256 EndDate;
    bool Exist;
    uint64 InNetwork;
    uint64 OutNetwork;
    uint64 OopIn;
    uint64 OopOut;
    /// @dev Accumulators Set to 64 bit because numbers in
    ///Accum hub are stored as 16 decimal numbers
  }


  struct Family
  {
    uint256 MemberId; ///@dev for linking Families
    /// @dev Accumulators Set to 64 bit because numbers in
    ///Accum hub are stored as 16 decimal numbers
    uint64 InNetwork;
    uint64 InNetworkMax;
    uint64 OutNetwork;
    uint64 OutNetworkMax;
    uint64 InNetOutOfPocket;
    uint64 InNetOutOfPocketMax;
    uint64 OutNetOutOfPocket;
    uint64 OutNetOutOfPocketMax;

  }
  ///@dev mapping as to link aliases to a single uuid
  // mapping (uint256 => uint256) public shaToUuid;
  ///@dev mapping to link a uuid to a member
  mapping (bytes32 => Member) public uuidToMember;
  ///@dev mapping to link a FamilyID to a family struct
  mapping (uint256 => Family) public famidToFamily;

  event FindMember(string Fn, string Ln, uint64 IN, uint64 OUT);
  event AddToAccum(bytes32 MemberSha, uint64 IN, uint64 OUT, uint64 InOop, uint64 OutOop);

  ///@dev to get member from sha

  // function setUuidNew(uint256 _memberSha, uint256 _uuid, uint256 _famId) public
  // {
  //   shaToUuid[_memberSha] = _uuid;
  //   Member memory _newMember = Member(_uuid, _famId, true, 0, 500, 0, 600, 0, 5050, 0, 6060);
  //   uuidToMember[_uuid] = _newMember;
  // }

  function setUuidNew(bytes32 _memberSha, string memory _firstname, string memory _lastname, uint256 _dob, uint256 _patientid, uint256 _memberid, uint256 _startdate, uint256 _enddate) public
  {
    // shaToUuid[_memberSha] = _patientid;
    Member memory _newMember = Member(_firstname, _lastname, _dob, _patientid, _memberid, _startdate, _enddate, true, 0, 0, 0, 0);
    uuidToMember[_memberSha] = _newMember;
  }

  // function attachAlias(uint256 _memberSha, uint256 _existingAlias) public
  // {
  //   shaToUuid[_memberSha] = shaToUuid[_existingAlias];
  // }


  function findMember(bytes32 _memberSha) public
  returns(string memory FirstName, string memory LastName, bool Exist, uint64 InNetwork, uint64 OutNetwork, uint64 OopIn, uint64 OopOut)
  {

    Member memory _myMember = uuidToMember[_memberSha];
    emit FindMember(_myMember.FirstName,_myMember.LastName, _myMember.InNetwork, _myMember.OutNetwork);
    return (_myMember.FirstName, _myMember.LastName,_myMember.Exist, _myMember.InNetwork,
     _myMember.OutNetwork, _myMember.OopIn, _myMember.OopOut);
  }

  function add2Accum(bytes32 _memberSha, uint64 _in, uint64 _out, uint64 _inoop, uint64 _outoop) public
  {
    Member storage _myMember = uuidToMember[_memberSha];
    _myMember.InNetwork += _in;

    _myMember.OutNetwork += _out;

    _myMember.OopIn = _inoop;

    _myMember.OopOut = _outoop;

    Family storage _myFamily = famidToFamily[_myMember.MemberId];
    _myFamily.InNetwork += _in;

    _myFamily.OutNetwork += _out;

    _myFamily.InNetOutOfPocket = _inoop;

    _myFamily.OutNetOutOfPocket = _outoop;

    emit AddToAccum(_memberSha, _in, _out, _inoop, _outoop);

  }


}
